description:
On the Other Hand, Death (2008)  

Verenigde Staten / Canada
Misdaad / Mystery
85 minuten

geregisseerd door Ron Oliver
met Chad Allen, Sebastian Spence en Margot Kidder

Wanneer de bewoners van een buurt enorme sommen geld aangeboden krijgen om hun huis te verkopen aan een projectontwikkelaar, weigert enkel een ouder lesbisch koppel. Kort daarop wordt hun huis vernield. De vraag is of het hier gaat om anti-homogeweld of andere motieven...


